import React from 'react';

class App extends React.Component {
    message = "salam";
    //constructor
    constructor(props){
        super()
        if(props.hasOwnProperty('text')){
            this.message = props.text
        }
    }
    //override
    render() {
        return (
            <div>
                {this.message}
            </div>
        );
    }
}

export default App;
